let data = ""

// First half
const react = data => {
  let cpt = 0
  while(data[cpt+1] != undefined){
    if( (data[cpt].charCodeAt(0) - data[cpt+1].charCodeAt(0)) === 32 || (data[cpt].charCodeAt(0) - data[cpt+1].charCodeAt(0)) === -32 ) {
        data = data.slice(0, cpt) + data.slice(cpt+2, data.length)
        //data = data.slice(0, cpt).concat(data.slice(cpt + 2));
        cpt--
        if(cpt === -1) cpt = 0
    }
    else{
      cpt++
    }
  }
  return data.length
}
console.log(react(data))


// Second half
let alphabet = "abcdefghijklmnopqrstuvwxyz"
let shortesPolymer = data.length
for(let i = 0; i < alphabet.length; i++){
  let char = alphabet[i]
  let charData = data.split('').reduce( (acc, currentLetter) => {
    if(currentLetter.toLowerCase() === char) return acc
    else return acc + currentLetter
  }, "")
  shortesPolymer = Math.min(shortesPolymer, react(charData))
}
console.log(shortesPolymer)
